import { Box, Container, Grid, Typography } from '@material-ui/core'
import Headshot from '../assets/headshot.jpg'

const aboutTile = [
    {
        title: "Our story",
        text: "We are a small team of glasses wearing nerds that have a passion for sharing people's stories. In today's modern world there is no better platform than a clean and beautiful website.",
    },
    {
        title: "Mission",
        text: "We want to develop a close relationship with our clients to ensure that you get the product you deserve.",
    },
    {
      title: "Vision",
      text: "FourEyes Tech wants to elevate and grow small local businesses. Today, more than ever, it is important to look out for one another.",
    },
  ]

const AboutMe = () => {
    return (
        <Box>
            <Container>
                <Typography variant="h2">
                    A little bit about me...
                </Typography>
                <Grid container>
                    {aboutTile.map((item, index) => (
                        <Grid item key={index} xs={12} md={4}>
                            <div class="aboutTile">
                            <Typography variant="h3">
                                {item.title}
                            </Typography>
                            <Typography variant="body1">
                                {item.text}
                            </Typography>
                            </div>
                        </Grid>
                    ))}
                </Grid>
            </Container>
        </Box>
    )
}

export default AboutMe
